import React from 'react';

const Header = () => {
  return (
    <header className="w-full bg-red-700 text-white p-4 flex justify-between items-center">
      <div className="text-xl font-bold">
        <img src="logo.png" alt="Logo" className="inline-block mr-3" />
        Anveshapandit Matrimony
      </div>
      <nav>
        <ul className="flex space-x-6">
          <li><a href="/" className="hover:text-yellow-400">Home</a></li>
          <li><a href="/" className="hover:text-yellow-400">About Us</a></li>
          <li><a href="/" className="hover:text-yellow-400">Careers</a></li>
          <li><a href="/" className="hover:text-yellow-400">Contact Us</a></li>
        </ul>
      </nav>
    </header>
  );
};

export default Header;
